import React from 'react'

export const Banner = () => {
  return (
    <section className="py-5 text-center container">
    <div className="row py-lg-5">
      <div className="col-lg-6 col-md-8 mx-auto">
        <h1 className="fw-light">Ejemplo de catálogo</h1>
        <p className="lead text-muted">Esta es una prueba con ReactJs + Laravel, que busca unir resultados de ambas herramientas, manteniendo exclusivamente el back-end a través de Laravel y exclusivamente el front-end a través de React</p>
      </div>
    </div>
  </section>
  )
}
